import React from "react";

const NoteForm = (props) => {
    const { formTitle , title , content , titleChanged, contentChanged, submitClicked,submitText}=props;

    return(
        <div>
            <h2>{formTitle}</h2>
            <div>
                <input
                type="text"
                name="title"
                className="form-input mb-30 placeholder-black"
                placeholder="العنوان"
                value={title}
                onChange={titleChanged}
                />

            <textarea
                rows="10"
                name="content"
                className="form-input"
                placeholder="النص"
                value={content}
                onChange={contentChanged}
            />
            <a href="#" className="button green rounded-full" onClick={submitClicked}>{submitText}</a>
            </div>
        </div>
    )
}

export default NoteForm;
